import React from 'react';
import Input from './Input';


function Fields({ type, ...rest }) {
    switch (type) {
        case "text":
        case "password":
        case "email":
            return React.forwardRef(({ type, ...rest }, ref) => (<Input type={type} {...rest} ref={ref} />))
        default:
            break;
    }
}

export default Fields;
